pub enum Event<Endpoint, ControlPoint> {
    Begin {
            at: Endpoint,
        },
    Line {
            from: Endpoint,
            to: Endpoint,
        },
    Quadratic {
            from: Endpoint,
            ctrl: ControlPoint,
            to: Endpoint,
        },
    Cubic {
            from: Endpoint,
            ctrl1: ControlPoint,
            ctrl2: ControlPoint,
            to: Endpoint,
        },
    End {
            last: Endpoint,
            first: Endpoint,
            close: bool,
        },
}
